import React, { useEffect } from "react";
import { NavLink } from "react-router-dom";

const Footer = () => {
    useEffect(() => {
        console.log("Footer component mounted");
        return () => {
            console.log("Footer component unmounted");
        }
    }, [])

    return (
        <div>
            <footer className="bg-red-500 rounded-lg shadow dark:bg-gray-900 m-4">
                <div className="w-full max-w-screen-xl mx-auto p-8 md:py-8">
                    <div className="sm:flex sm:items-center sm:justify-between">
                        <ul className="flex flex-wrap items-center mb-6 text-sm font-medium text-gray-500 sm:mb-0 dark:text-gray-400">
                            <li>
                                <a href="#" className="bg-red-500 hover:bg-red-700 text-white px-4 py-2 rounded-lg me-8 md:me-20">About</a>
                            </li>
                            <li>
                                <a href="#" className="bg-red-500 hover:bg-red-700 text-white px-4 py-2 rounded-lg me-4 md:me-20">Privacy Policy</a>
                            </li>
                            <li>
                                <a href="#" className="bg-red-500 hover:bg-red-700 text-white px-4 py-2 rounded-lg me-4 md:me-20">Licensing</a>
                            </li>
                            <li>
                                <a href="#" className="bg-red-500 hover:bg-red-700 text-white px-4 py-2 rounded-lg me-4 md:me-20">Contact</a>
                            </li>
                        </ul>
                    </div>
                    <hr className="my-6 border-gray-200 sm:mx-auto dark:border-gray-700 lg:my-8" />
                    <span className="block text-sm text-gray-500 sm:text-center dark:text-gray-400">
                        © 2023 <a href="https://flowbite.com/" className="hover:underline">Flowbite™</a>. All Rights Reserved.
                    </span>
                </div>
            </footer>
        </div>
    );
}

export default Footer;
